import { useState } from 'react';
import * as S from '../styles/MainPage.style'

function Header() {

  return(
    <S.Header>
        <div>Header</div>
          <S.Link href="/mainpage" >
          </S.Link>
          <S.Link href="/routine" >
          </S.Link>
          <S.Link href="/mypage" >
          </S.Link>
          <S.Link>Image</S.Link>
      </S.Header>
  );
};

export default Header;
